(9, 'olap system overview', ' -- olap_sidebar -- open learning analytics ecosystem open learning analytics ecosystem open learning analytics ecosystem theu800 open learning analytics platform ofu800 theu800 rwth template ref_chatti2015learningecosystem isu800 au800 project which objective isu800 tou800 provide anu800 ecosystem foru800 learning analytics foru800 different stakeholders. theu800 platform will gather data from multiple sources utilize different methods andu800 apply them tou800 provide insight onu800 theu800 data tou800 theu800 users learners teachers andu800 researchers developers . theu800 main users ofu800 theu800 project areu800 students will utilize theu800 data tou800 provide themselves with insight onu800 course performance comparison with other students andu800 oru800 cohorts receive recommendations onu800 learning materials andu800 subjects revise achievements andu800 goals inu800 courses andu800 education process. theu800 student will beu800 able tou800 create inquiries andu800 utilize available data from different sources tou800 approach answers tou800 these inquiries. teachers uses theu800 olap platform asu800 au800 complement ofu800 theu800 learning management systems. utilizes data visualization ofu800 theu800 olap tou800 personalize dashboards with information about student performance comparison with cohorts monitoring ofu800 activity developers researchers canu800 create newu800 analytics methods andu800 analytics modules inu800 order tou800 provide other users newu800 ways ofu800 making sense ofu800 data andu800 mechanisms tou800 process theu800 data. canu800 also provide newu800 ways ofu800 visualizing theu800 data. canu800 develop descriptive andu800 predictive models foru800 data analysis asu800 analytic methods. canu800 create modules foru800 theu800 collection ofu800 data from third party applications andu800 integrate those modules onu800 theu800 platform. canu800 useu800 theu800 platform tou800 create custom indicators andu800 provide insight tou800 particular research inquiries. functional requirements functional requirements functional requirements theu800 functional requirements areu800 gathered inu800 base ofu800 three main scenarios that derive theu800 main functionalities ofu800 theu800 system. theu800 scenarios will beu800 treated asu800 theu800 main useu800 cases ofu800 theu800 system andu800 will beu800 presented here asu800 such since they will beu800 theu800 main drivers ofu800 theu800 olap architecture. scenarios scenarios scenarios theu800 scenarios areu800 taken from section 4u800u82e2u800 andu800 section 4u800u82e4u800 ofu800 theu800 paper  toward anu800 open learning analytics ecosystem chatti etu800. alu800.   . they represent theu800 main usage ofu800 theu800 system. they areu800 divided byu800  teacher   student  andu800  developer researcher  scenarios with theu800 addition ofu800 twou800 more theu800 general useu800 scenarios  newu800 indicator generation  andu800 au800 system interaction scenario  indicator data request . teacher scenario teacher scenario teacher scenario au800 teacher utilizes anu800 external lmsu800 system tou800 administer courses. theu800 teacher hasu800 access tou800 au800 personalized dashboard ofu800 theu800 olap andu800 from itu800 itu800 canu800 seeu800 anu800 overview ofu800 courses with certain indicators. theu800 indicators areu800 theu800 main information source tou800 improve teaching. theu800 dashboard provides predefined indicators. examples ofu800 theu800 indicators include involvement ofu800 students onu800 forums participation ofu800 students inu800 course document usage statistics progress ofu800 students onu800 assignments learning materials discussed inu800 forums. theu800 teacher canu800 also create newu800 indicators from anu800 indicator editor from which canu800 specify which indicator tou800 useu800 andu800 what visualization tou800 apply tou800 theu800 indicator. theu800 creation ofu800 indicators isu800 made available tou8